      "coordinates": null,
      "creationMethod": null,
      "dateLastActivity": "2021-02-03T03:50:24.225Z",
      "desc": "I would like to share some special cases that I experienced when calling DOPA API to you.\n\n1. Somebody has no birth day or birth month. In this case, to send API to DOPA please fill the missing date/month with 00. Ex. “- - 2543” --> “25430000\" >> cannot submit in web app\n\n2. Somebody has space between their last name. In this case you have to replace space with “+” Ex. “อิศรางกูร ณ อยุธยา” --> “อิศรางกูร+ณ+อยุธยา” >> cannot submit in web app\n\n3. Somebody has space between their first name. In this case you have to cut and use only first word Ex. “พริ๊นซ์แพร์รีส แจ็คสันว์” --> “พริ๊นซ์แพร์รีส” >> cannot submit in web app\n\n4. If there is a year translation between ค.ศ. to พ.ศ. somewhere in the code, please make sure it’s working with 29 Feb (leap year) >> this shouldn't happen.\n",
      "descData": { "emoji": {} },
