      "dateLastActivity": "2021-02-03T03:50:24.170Z",
      "desc": "- As an application approver, I am able to get a google sheet file containing all application data so that I can review and approve/reject the merchants.\n- Once the application data is integrated into SF, Approver will access and approve/reject the application first, before letting the KYC or CMS agents complete the workflow on SF.\n- This is to make sure that an approval process is dependent on only one person rather than multiple agents (KYC and CMS). Therefore we are more certain to complete the approval within the SLA of 3 days.\n\nAC:\n**Application data + Folder link on Google Sheet store on Google Driver**\n- File updated once status is “Registration Approved” \n- Data updated hourly within the same google sheet until archive period\n- How agents manage files? - Data will be query to a separate sheet with exactly the same format for agents as a working sheet.\n\n**Files store in Google Cloud Storage** \n- All files of one merchant store in one folder\n- Data updated hourly \n- File name in spec dochttps://docs.google.com/document/d/10MdOccsNhjE5e4QXDtJ-rFtl3snuYuWyU7tRiNZz-r8/edit#heading=h.s92cv77rynl5\n\n**Create card on Trello** \n- Web app send email to auto create card on Trello board trigger from mailgun\n- Card details:\nEmail recipient: <Smith to provide>\nEmail Subject = card subject: <application ID> - <ID card no.>\nEmail Body = card description: \nชื่อร้านอาหาร + สาขา\nชื่อเจ้าของร้าน\nเลขบัตรประชาชน\nจำนวนหมวดประเภทอาหาร\nจำนวนรายการอาหาร\ncreated_at\nLink to Google Sheet with app data \nLink to Google Drive folder with files and images\n\n",
