      "desc": "AC:\n\n- There are 4 sub steps in the application\n- Please follow Fields name, Placeholder, Required, Format, Validation, Tool tips, error messages  in this  in this sheet\n\nOwner’s profile\n- DOPA check against ID card details once merchant click on “next” button\nIf fail, show error message in pop up\n- For birth date, Salesforce requires คศ.\nShow on FE as พศ., but convert to BE as คศ.\n\nOutlet & Menu\n- Merchant is able to view GoBiz manual in PDF file to study how to fill in application correctly\n- For tool tips that are too long, show as pop up\n- When click on placeholder/folder uploader first time, then show tooltip pop up\n\nBank account information\n- Merchants must use SCB only\n\n- Once the 4 steps are completed, merchant is able to review what they have filled out in the summary page\n- Merchant can go back in Restaurant’s information, Menu information, Bank account information, and Summary page to edit information on the previous page\n- Once merchant submitted the summary page, merchant cannot go back to edit information anymore\n",
