      "dateLastActivity": "2021-02-03T03:50:24.113Z",
      "desc": "AC:\n\n- Merchant must fill in email, ID card number, and mobile phone number\n\n- Check format against email, ID card number, and mobile phone number\nemail format\nMobile phone no.: +66XXXXXXXXX (ตัด 0 ออก), starts with 08, 09, or 06\nID card no.: digit check https://www.memo8.com/%E0%B8%A7%E0%B8%B4%E0%B8%98%E0%B8%B5%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%84%E0%B8%B3%E0%B8%99%E0%B8%A7%E0%B8%93%E0%B9%80%E0%B8%9E%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B8%95%E0%B8%A3%E0%B8%A7%E0%B8%88%E0%B8%AA/\nIf pass then check the AMLO list https://docs.google.com/spreadsheets/d/1OoB9PxFfBPBTiDxvYWkfymM5oCJ_Z_CkGTOM-j97Iaw/edit#gid=0\nIf fail, then show the error message\n- Check ID card number with AMLO list\nKYC agent has access to maintain the AMLO list once in a while\nIf pass, then check the duplication\nIf fail, show the error pop up\n- Check duplication against email, ID card number, and mobile phone number in the web app database. \nIf pass, then proceed to email activation page\nIf fail, show the error message\n- Merchant can view the Privacy Policy https://www.getthailand.com/privacy-th/\n- If merchant realised that they’ve already applied before, merchant can go to login page\n- If merchant register with the same email, phone no., and ID card no., then redirect merchant as they are logging in\n- If merchant register with the same phone no., and ID card no., but different email → Check if email has been verified\nIf yes, then cannot proceed with registration. Show error message that this email has already been registered\nIf no, then proceed by creating a new account\nThis is allowed in case merchants use an email address that is not active and may forget the password to login to get the security code, therefore is not able to verify their email. \n",
